import {Homeppal} from "./componentes/homebioprep/Homeppal.jsx";
import "./App.css";
import {Head} from "./componentes/headboard/head.jsx";
import {nosotros} from "./componentes/nosotros/nosostros.jsx";
import { BrowserRouter, Route, Routes } from "react-router-dom";

function App() {

  return (

    
      <div>
        <BrowserRouter>
        <div className="App">
          <Head/>
        </div>
        <Routes>
        <Route path="/" element = {Homeppal}/>
        <Route path="/nosotros" element={nosotros}/>
        </Routes>
        </BrowserRouter> 
    </div>

  );
}

export default App;
